using System;
using DistinctEchoSubstrings;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace DistinctEchoSubstringsTest
{
    [TestClass]
    public class UnitTest1
    {
        [TestMethod]
        public void TestMethod1()
        {
            Solution s = new Solution();
            var result = s.DistinctEchoSubstrings("abcabcabc");
            Assert.AreEqual(result, 3);
        }

        [TestMethod]
        public void TestMethod2()
        {
            Solution s = new Solution();
            var result = s.DistinctEchoSubstrings("leetcodeleetcode");
            Assert.AreEqual(result, 2);
        }

        [TestMethod]
        public void TestMethod3()
        {
            Solution s = new Solution();
            var result = s.DistinctEchoSubstrings("");
            Assert.AreEqual(result, 1000);
        }
    }
}
